import React, { Component } from 'react';
import './App.css';

class App extends Component {
    render() {


        let image = {
                backgroundImage:'url("https://www.thebalance.com/thmb/INfVkubFAvZz8cfPV9cAx1TOdUo=/2122x1415/filters:no_upscale():fill(transparent,1)/486990777-56a938bc3df78cf772a4e5f7.jpg")', 
                backgroundSize:'cover',
                // color:'black'
            }

//         .jumbotron {
//   background-image: url("../img/jumbotron_bg.jpg");
//   background-size: cover;
// }


        return (
            <div className="App">

                <nav class="navbar navbar-light">
                  <a class="navbar-brand" href="#">Navbar</a>
                </nav>

                <div style={image} className="jumbotron">
                    <h1 className="display-4">Create a 1099 in Minutes</h1>
                    <p className="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>

                    <hr className="my-4" />

                    <a class="btn btn-primary btn-lg" href="#" role="button">Get Started</a>
                    <br/>
                    <br/>
                    <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
                </div>


            </div>
        );
    }
}

export default App;
